import React from "react";
import ReactDom from "react-dom";
import "./index.css"
var wish;
var time = new Date();
time = time.getHours();

if (time >= 1 && time <= 12) {
  wish = "GoodMorning";
} else if(time>=12 && time<=21){
  wish = "GoodAfternoon";
}else{
  wish = "MidNight";
}




ReactDom.render(
  < div className="full">
    <div className="center">
      <h1  >Hello Sir,{wish}</h1>
    </div>
  </div>
  , document.getElementById("root")
)
